        setWidth();
        await OnHandleChanged(Param.TimeRange, nameof(Param.TimeRange));
        await OnHandleChanged(Param.Number_of_days, nameof(Param.Number_of_days));
        await OnHandleChanged(Param.DisplayRange, nameof(Param.DisplayRange));
